import React from 'react';
import { Container, Row, Col } from 'reactstrap';
import thankYouImg from '../assets/images/thankyou.png'; // Make sure to have this image

const ThankYou = () => {
  return (
    <section>
      <Container>
        <Row>
          <Col lg='8' className="m-auto text-center">
            <div className="thank-you">
              <img src={thankYouImg} alt="Thank You" />
              <h2>Thank You for Your Booking!</h2>
              <p>Your booking has been successfully completed. We look forward to seeing you!</p>
            </div>
          </Col>
        </Row>
      </Container>
    </section>
  );
};

export default ThankYou;
